import React from "react";
import "./App.css";
import ProductsGrid from "./components/products";
import Button from "react-bootstrap/Button";
const Btn = () => {
  return (
    <div>
      <Button variant="primary">Primary</Button>
    </div>
  );
};

function App() {
  return (
    <div className="App">
      <div>front ecommerce</div>
      <ProductsGrid />
      <Btn />
    </div>
  );
}

export default App;
